import "./App.scss";
import Header from "./components/Header";
import TableXuatXu from "./components/TableXuatXu";
import Container from "react-bootstrap/Container";

function App() {
  return (
    <div className="app-container">
      <Header />
      <Container>
        <div className="my-3">
          <TableXuatXu />
        </div>
      </Container>
    </div>
  );
}

export default App;
